import React, { Component } from 'react';

class Login extends Component {
  render() {
    return (
      <div>
        <form>
              <label>Name</label>
              <input type="text" value={this.state.inputvalue} onChange={this.handleChange}/>
              <input type="submit" value="Submit"/>
          </form>
      </div>
    );
  }
}

export default Login;

